import React from 'react';

function Video() {
  return <div><iframe className='vd' width="720" height="405" src="https://www.youtube.com/embed/JrEEKaDSF4k" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe></div>;
}

export default Video;
